import React from 'react';
import { Link } from 'react-router-dom';
import logo from './images/logo2.png';

function Landingpage() {
  return (
    <div>
      <div className='top-session'>
      <img src={logo} className='img'/>
           

      </div>
    </div>
  );
}

export default Landingpage;
